window.bookSummaryJSON = "<p>Part 4 is an easy listening and inspiring biography of the life and teachings of Jesus. This narrative spans his life from his birth in Bethlehem to his death in Jerusalem. The authors describe his childhood, his struggles to overcome teenage problems, his travels and adventures, and his fascinating episodes of personal and public ministry. While <i>The Urantia Book</i>'s presentation of Jesus generally corresponds with the Bible, it stands unique, packed with new information and fresh insights. </p> <p><i>The Urantia Book</i> fills in the 30 years of Jesus’ life missing from the New Testament. If you’re interested in learning a great deal more about Jesus, you’ll gain deep understanding of his life and teachings from Part 4 of <i>The Urantia Book</i>.</p> <p> Highlights of Part 4 include: The missing years of Jesus' life; the premature death of Jesus' father; Jesus helping to raise his seven brothers and sisters; Rebecca's proposal of marriage; Jesus' work as a carpenter, boat builder, scribe, teacher, and camel caravan conductor; his journeys to Egypt, Rome, and the Caspian Sea; his life with the apostles; stories of the hundreds of people Jesus helped; healing the sick; the dark days preceding the crucifixion; Jesus' resurrection and appearances; the power of the Spirit of Truth; and the mysterious nature of the human and divine Jesus.</p>"; 
